public long getSharedLogCTime() throws IOException {
  for (JournalAndStream jas : journalSet.getAllJournalStreams()) {
    if (jas.isShared()) {
      return jas.getManager().getJournalCTime();
    }
  }
  throw new IOException("No shared log found.");
}
